import React from "react";

export default function contactMe() {
    return (
        <main>
            <div className="container">
                <section className="about-info">
                    <h2 id="contact">Contact Me</h2>
                    <p id="email">pdavsDU@gmail.com</p>
                    <p>817-253-9554</p>
                    <a href="https://github.com/pdavisDU">Github</a>
                    <a href="https://www.linkedin.com/in/paul-davis-58663a74/">LinkedIn</a>
                </section>
            </div>
        </main>
    );
}
